import './App.css';
import { Button, Navbar, Container } from 'bootstrap';

function App() {
  return (
    <Container>
      <Navbar>
        <Navbar.Brand>My App</Navbar.Brand>
      </Navbar>
      <Button variant="primary">Click me</Button>
    </Container>
  );
}

export default App;
